import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { BrowserRouter, Routes, Route, useLocation } from 'react-router-dom';
import { Home } from './Pages/Home';
import { MusicalCategory } from './Pages/MusicalCategory';
import { Cart } from './Pages/Cart';
import { Product } from './Pages/Product';
import { LoginSignup } from './Pages/LoginSignup';
import { FirstPage } from './Pages/FirstPages/FirstPage';
import Nav from 'react-bootstrap/Nav';
// import AppContent from './Components/Navbar/Navbar';

function AppContent() {
  const location = useLocation();
  const isFirstPage = location.pathname === '/';

  return (
    <div>
      {!isFirstPage && (
        <div>
          <div className="nav-logo">
            {/* <img src={logo} alt="" /> */}
            <p>OM:D</p>
        </div>
          <Nav fill variant="tabs" defaultActiveKey="/home">
            <Nav.Item>
              <Nav.Link href="home">Home</Nav.Link>
            </Nav.Item>
            <Nav.Item>
              <Nav.Link href="musicals">Musicals</Nav.Link>
            </Nav.Item>
            <Nav.Item>
              <Nav.Link href="products">Product</Nav.Link>
            </Nav.Item>
            <Nav.Item>
              <Nav.Link href="dataAnalysis">Data Analysis</Nav.Link>
            </Nav.Item>
          </Nav>
        </div>
      )}
    </div>
  );
}

function App() {

  return (

    <BrowserRouter>
      <AppContent />
      <Routes>
        <Route path="/" element={<FirstPage />} />
        <Route path="/home" element={<Home />} />
        <Route path="/musicals" element={<MusicalCategory />} />
        <Route path="/product" element={<Product />} />
        <Route path="/cart" element={<Cart />} />
        <Route path="/login" element={<LoginSignup />} />
        <Route path="*" element={<Home />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
